import React from 'react';

import Header from './Header';

function App() {
  let counter = 0;

  function Add(){
    counter ++;
  }
  return (
    <div>
      <Header>Contador: {counter}</Header>
      <button>Adicionar</button>
    </div>
  );
}

export default App;
